import "./hero.css";
import Button from "./button";

const Hero = () => {
  return (
    <div className="hero-container">
      <h1>ADVENTURE AWAITS</h1>
      <p>What are you waiting for?</p>
      <br></br>
      <div className="hero-btns">
        <Button text="Get Started" style="btn-outline" />
        <Button
          text={`WATCH TRAILER)}`}
          style="btn-primary"
        />
      </div>
    </div>
  );
};

export default Hero;
